import React from 'react';
import './Modal.css';

export default function PlanModal({ visible, onClose, onCreate, planName, setPlanName, description, setDescription }) {
  if (!visible) return null;

  return (
    <div className="modal-overlay" onClick={onClose}>
      <div className="modal" onClick={e => e.stopPropagation()}>
        {/* Header */}
        <div className="modal-header">
          <h2>Plan Name</h2>
          <button className="modal-close" onClick={onClose}>
            X
          </button>
        </div>

        {/* Body */}
        <div className="modal-body">
          <label className="modal-label">Name</label>
          <div className="modal-input-group">
            <input
              type="text"
              value={planName}
              onChange={e => setPlanName(e.target.value)}
            />
          </div>

          <label className="modal-label">Descript</label>
          <textarea
            rows="4"
            placeholder="설명 들어갈 칸"
            value={description}
            onChange={e => setDescription(e.target.value)}
          />

          <button className="image-upload">
            321
          </button>
        </div>

        {/* Footer */}
        <div className="modal-footer">
          <button className="btn-create" onClick={onCreate}>
            Create
          </button>
        </div>
      </div>
    </div>
  );
}
